It is absolutely a bad way to implement a tuple (a, b) by Array. Especially since Rust support tuples, storing two number (start time and finish time) in Vector is not the good practice. The following code is alternative implementation and solution. type Interval = (i32, i32); struct Solution{} impl Solution { pub fn erase_overlap_intervals(intervals: Vec<Interval>) -> i32 { let mut intervals = intervals; intervals.sort_by( |(_,f1), (_,f2)| f1.cmp(&f2) ); let mut count = 0; let (mut prev_start, mut prev_end) = intervals[0]; for (curr_start, curr_end) in intervals.into_iter().skip(1) { if curr_start < prev_end { count += 1; } else{ prev_start = curr_start; prev_end = curr_end; } } return count; }
} fn main(){ println!("{}", Solution::erase_overlap_intervals( vec![(1,2),(2,3),(3,4),(1,3)] ) ); println!("{}", Solution::erase_overlap_intervals( vec![(1,2),(1,2),(1,2)] ) ); println!("{}", Solution::erase_overlap_intervals( vec![(1,2),(2,3)] ) );
}

