impl Solution { pub fn reverse_list(head: Option<Box<ListNode>>) -> Option<Box<ListNode>> { let mut curr = head; let mut prev = None; while let Some(mut node) = curr.take() { curr = node.next; node.next = prev; prev = Some(node); } return prev; } pub fn add_two_numbers(l1: Option<Box<ListNode>>, l2: Option<Box<ListNode>>) -> Option<Box<ListNode>> { let mut carry : i32 = 0; let mut l1 = l1; let mut l2 = l2; let mut curr = Some(Box::new(ListNode::new(0))); // Dummy head while l1.is_some() || l2.is_some() || carry > 0 { let mut sum = carry; if let Some(node) = l1 { sum += node.val; l1 = node.next; } if let Some(node) = l2 { sum += node.val; l2 = node.next; } let mut node = ListNode::new(sum % 10); node.next = curr; curr = Some(Box::new(node)); carry = sum / 10; } curr = Solution::reverse_list(curr); if let Some(node) = curr { curr = node.next; } return curr; }
}

