/** * Definition for singly-linked list. * struct ListNode { * int val; * ListNode *next; * ListNode() : val(0), next(nullptr) {} * ListNode(int x) : val(x), next(nullptr) {} * ListNode(int x, ListNode *next) : val(x), next(next) {} * }; */
class Solution {
public: ListNode* addTwoNumbers(ListNode* l1, ListNode* l2) { ListNode * dummyHead = new ListNode(); ListNode * curr = dummyHead; int carry = 0; while( l1 != nullptr || l2 != nullptr || carry > 0){ int val = (l1 != nullptr ? l1->val : 0) + (l2 != nullptr ? l2->val : 0) + carry; carry = val >= 10 ? 1 : 0; curr->next = new ListNode( val % 10 ); curr = curr->next; l1 = (l1 == nullptr) ? nullptr : l1->next; l2 = (l2 == nullptr) ? nullptr : l2->next; } return dummyHead->next; }
};

