/** * Definition for singly-linked list. * public class ListNode { * int val; * ListNode next; * ListNode() {} * ListNode(int val) { this.val = val; } * ListNode(int val, ListNode next) { this.val = val; this.next = next; } * } */
class Solution { public ListNode removeNthFromEnd(ListNode head, int n) { ListNode currentNode = head; int len = 0; while(currentNode != null){ len++; currentNode = currentNode.next; } ListNode sentinelHead = new ListNode(-1, head); currentNode = sentinelHead; while( len - n > 0 ){ n++; currentNode = currentNode.next; } currentNode.next = currentNode.next.next; return sentinelHead.next; }
}

