impl Solution { pub fn remove_nth_from_end(head: Option<Box<ListNode>>, n: i32) -> Option<Box<ListNode>> { let mut n = n; // Reverse The List let mut curr = head; let mut prev = None; while let Some(mut node) = curr.take() { curr = node.next; node.next = prev; prev = Some(node); } // Reverse again and delete curr = prev; prev = None; while let Some(mut node) = curr.take() { n-=1; if (n != 0){ curr = node.next; node.next = prev; prev = Some(node); }else{ curr = node.next; } } return prev; }
}
